import { useState, useCallback } from 'react';

export default function useMostClickedColor() {
    const [mostClicked, setMostClicked] = useState(null);

    const setMostClickedCounter = useCallback(() => {
        setMostClicked(mostClicked + 1)
    }, [mostClicked]);

    return { mostClicked, setMostClickedCounter };
}
